import Image from '../static/Image';
import 'swiper/css/swiper.css';

SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

//swiper使用



const SimpleSwiper = () => (
  <Swiper>
    <div>Slide 1</div>
    <div>Slide 2</div>
    <div>Slide 3</div>
    <div>Slide 4</div>
    <div>Slide 5</div>
  </Swiper>
)
